## Issue Details

It seems that the order of parameters in the call `corefine_and_compute_difference(mesh1, mesh2, mesh)` does not match the documentation.
According to the doc the result is the volume bounded by mesh1 minus the volume bounded by mesh2, but in realty it is the opposite.

[CMakeLists.txt](https://github.com/user-attachments/files/21823032/CMakeLists.txt)
[input.tar.gz](https://github.com/user-attachments/files/21823044/input.tar.gz)

## Source Code

```
#include <iostream>
#include <string>

#include <CGAL/Exact_predicates_inexact_constructions_kernel.h>
#include <CGAL/Exact_predicates_exact_constructions_kernel.h>
#include <CGAL/Surface_mesh.h>
#include <CGAL/draw_surface_mesh.h>
#include <CGAL/Polygon_mesh_processing/corefinement.h>
#include <CGAL/Polygon_mesh_processing/IO/polygon_mesh_io.h>

typedef CGAL::Exact_predicates_inexact_constructions_kernel K;
typedef CGAL::Exact_predicates_exact_constructions_kernel EK;
typedef CGAL::Surface_mesh<K::Point_3> Mesh;
typedef boost::graph_traits<Mesh>::vertex_descriptor vertex_descriptor;
typedef Mesh::Property_map<vertex_descriptor,EK::Point_3> Exact_point_map;

namespace PMP = CGAL::Polygon_mesh_processing;
namespace params = CGAL::parameters;

struct Exact_vertex_point_map {
  // typedef for the property map
  typedef boost::property_traits<Exact_point_map>::value_type value_type;
  typedef boost::property_traits<Exact_point_map>::reference reference;
  typedef boost::property_traits<Exact_point_map>::key_type key_type;
  typedef boost::read_write_property_map_tag category;

  // exterior references
  Exact_point_map exact_point_map;
  Mesh* tm_ptr;

  // Converters
  CGAL::Cartesian_converter<K, EK> to_exact;
  CGAL::Cartesian_converter<EK, K> to_input;

  Exact_vertex_point_map() : tm_ptr(nullptr) {}

  Exact_vertex_point_map(const Exact_point_map& ep, Mesh& tm) : exact_point_map(ep), tm_ptr(&tm) {
    for (Mesh::Vertex_index v : vertices(tm)) exact_point_map[v]=to_exact(tm.point(v));
  }

  friend reference get(const Exact_vertex_point_map& map, key_type k) {
    CGAL_precondition(map.tm_ptr != nullptr);
    return map.exact_point_map[k];
  }

  friend void put(const Exact_vertex_point_map& map, key_type k, const EK::Point_3& p) {
    CGAL_precondition(map.tm_ptr!=nullptr);
    map.exact_point_map[k]=p;
    // create the input point from the exact one
    map.tm_ptr->point(k)=map.to_input(p);
  }
};

int main(int argc, char* argv[]) {
  const std::string filename1 = (argc > 1) ? argv[1] : CGAL::data_file_path("meshes/blobby.off");
  const std::string filename2 = (argc > 2) ? argv[2] : CGAL::data_file_path("meshes/eight.off");

  Mesh mesh1, mesh2, mesh3;
  if (! PMP::IO::read_polygon_mesh(filename1, mesh1) || ! PMP::IO::read_polygon_mesh(filename2, mesh2)) {
    std::cerr << "Invalid input." << std::endl;
    return 1;
  }

  Exact_point_map mesh1_exact_points = mesh1.add_property_map<vertex_descriptor, EK::Point_3>("v:exact_point").first;
  Exact_point_map mesh2_exact_points = mesh2.add_property_map<vertex_descriptor, EK::Point_3>("v:exact_point").first;
  Exact_point_map mesh3_exact_points = mesh3.add_property_map<vertex_descriptor, EK::Point_3>("v:exact_point").first;
  Exact_vertex_point_map mesh1_vpm(mesh1_exact_points, mesh1);
  Exact_vertex_point_map mesh2_vpm(mesh2_exact_points, mesh2);
  Exact_vertex_point_map mesh3_vpm(mesh3_exact_points, mesh3);

  CGAL::draw(mesh1);
  CGAL::draw(mesh2);

  if (! PMP::corefine_and_compute_difference(mesh1, mesh2, mesh3,
                                           params::vertex_point_map(mesh1_vpm),
                                           params::vertex_point_map(mesh2_vpm),
                                           params::vertex_point_map(mesh3_vpm))) {
    std::cout << "Difference could not be computed\n";
    return 1;
  }

  CGAL::draw(mesh3);
  return 0;
}

